import React, { Component } from 'react'
import { Container } from 'react-bootstrap'

export default class NewListings extends Component {
    render() {
        return (
            <Container>
                <div class="d-flex justify-content-center">
                    <h3>New Listings</h3>
                </div>
            </Container>
        )
    }
}
